import React from "react";
import TemplateAnime from "../Elementos/templateAnime"


function Fullmetal(){
    return(
        <div>
            <TemplateAnime LinkAnime="https://iframe.mediadelivery.net/embed/64523/3e83ff11-f7cf-4594-b387-c524f5ff3116?autoplay=true" TituloAnime="Fullmetal Alchemist: Brotherhood " TituloCap="Episodio 1 – Fullmetal Alchemist" DescAnime="Edward y Alphonse son dos jóvenes alquimistas que trabajan para el ejército de Central luchando contra todos los enemigos que perturban la paz en la nación. En este caso, el Alquimista de Hielo intenta destruir el país y acabar con King Bradley."/>
        </div>
    );
}

export default Fullmetal;
